import React, { useState } from 'react';

function Losowanie2() {
  const [numbers, setNumbers] = useState([]);

  const generateRandomNumber = () => {
    // Wygeneruj losową liczbę od 1 do 100
    const randomNumber = Math.floor(Math.random() * 100) + 1;
    
    let newNumbers;
    if (numbers.length === 3) {
      // Usuń ostatni element tablicy i dodaj nową liczbę
      newNumbers = [...numbers.slice(1), randomNumber];
    } else {
      newNumbers = [...numbers, randomNumber];
    }
    setNumbers(newNumbers);
  }

  return (
    <div>
      <button onClick={generateRandomNumber}>Generuj losową liczbę</button>
      {numbers.map((number, index) => (
        <div key={index}>{number}</div>
      ))}
    </div>
  );
}

export default Losowanie2;
